import React from "react";
import Encabezado from "./Encabezado";
import ReactDOM from 'react-dom';
import { Route, Router, Routes } from 'react-router-dom';

import { BrowserRouter } from 'react-router-dom';

function P_Principal(){
    return(
      <div className="contenido_pagina">
        <div>
          <BrowserRouter>
            <div className='contenedor_pagina'>
              <Encabezado />
            </div>
            <Routes>
              <Route path='/Pagina_Principal' element={<P_Principal />} />
              <Route path='/Pagina_Productos' element={<P_Productos />} />
            </Routes>
          </BrowserRouter>
        </div>
        <img className="imagen_fondo_Pprincipal" src={require('../Imagenes/GI.jpg')} />
      </div>
    );
}

export default P_Principal;
